import styled from "styled-components";
import LogoImage from '../../assets/image/logo.png';
import { useNavigate } from "react-router-dom";
import BtnLogo from "./BtnLogo";


const Header = () => {
    const navigate = useNavigate();

    const goToMain = () => {
        navigate('/');
    }

    return (
        <div>
            <BtnLogo />
        </div>
    );
}

export default Header;
